import React from 'react';

const HoverMe = () => {
    const [count,setCount]=useState(0);
    return (
        <div>
            <div>
            <button onBlur={(e)=>setCount(count+1)}>Click</button>
            <p>{count}</p>
        </div>
        </div>
    );
};

export default HoverMe;
